#include <algorithm>
#include <queue>
using namespace std;

class Solution
{
public:
    bool canJump(vector<int> &nums)
    {
        int n = nums.size();
        queue<int> q;
        vector<bool> visited(n, false);

        q.push(0);
        visited[0] = true;

        int farthest = 0;

        while (!q.empty())
        {
            int cur = q.front();
            q.pop();

            int maxReach = cur + nums[cur];
            for (int i = max(farthest + 1, cur + 1); i <= maxReach && i < n; i++)
            {
                if (!visited[i])
                {
                    if (i == n - 1)
                        return true;
                    visited[i] = true;
                    q.push(i);
                }
            }
            farthest = max(farthest, maxReach);
        }
        return false;
    }
};

